import React from 'react'

import { BsTrash2 } from 'react-icons/bs';

export const LiNavBar = ({array, deleteFavorite}) => {
  console.log(array.length)
  if (array.length==0){
    <li className="li-Dropdown">
      <a className="dropdown-item pe-1" href="#">Empty</a>
    </li>
  }
  if (array.length>0) {
    array.map(item=>{
      return (
        <li className="li-Dropdown">
          <a className="dropdown-item pe-1" href="#">{item.name}</a>
          <BsTrash2 className="iconNavBar" onClick={()=>deleteFavorite(item.id)}/>
        </li>
      )
    })
  }
}
